import classes from '../style/Login.module.css';

function Login() {
    return (
        <div className={classes.loginpanel}>
            <div></div>
            <div>
                <form method='get'>
                    <input type='text'/>
                    <input type='password'/>
                    <button type='submit'></button>
                </form>
            </div>
        </div>
    )
}

export default Login;
